    data: |
      SELECT DISTINCT + - cor0.col1 * ( - cor0.col2 ) * col0 + 26 + - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q254.out
    data: |
      36449
      4184
      99770
